import Head from "next/head";
import Navbar from "./Navbar";
const Layout = props => (
	<div>
		<Head>
			<title>Bitz</title>
			<link rel="stylesheet" href="./components/bootstrap.min.css" />
		</Head>
		<Navbar />
		{props.children}
	</div>
);
export default Layout;
